                    </div>  
                    <div className="col-lg-3 bggreen">
                          <div className="col-lg-12 emptybox1"></div>
                          <div className="col-lg-12 emptybox2"></div>
                          <div className="text-center"><img src="/images/g3.png"/></div>
                    </div>  
                </div>  
              </div>
          </div>
    </div>
      );
     }
}
